/*View structure for view animal_report */

/*!50001 DROP TABLE IF EXISTS `animal_report` */;
/*!50001 DROP VIEW IF EXISTS `animal_report` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `animal_report` AS select `a`.`id` AS `id`,`a`.`code` AS `code`,`a`.`name` AS `name`,date_format(`a`.`birthdate`,'%d-%m-%Y') AS `birthdate`,`c`.`prefix` AS `prefix`,trim(if(isnull(`c`.`names`),'',`c`.`names`)) AS `breeder`,trim(if(isnull(`e`.`names`),'',`e`.`names`)) AS `owner`,`mom`.`prefix` AS `mom_prefix`,`mom`.`name` AS `mom_name`,`dad`.`prefix` AS `dad_prefix`,`dad`.`name` AS `dad_name` from ((((((`animals` `a` left join `animal_agent` `b` on(((`b`.`animal_id` = `a`.`id`) and (`b`.`type` = 'breeder')))) left join `agents` `c` on((`c`.`id` = `b`.`agent_id`))) left join `animal_agent` `d` on(((`d`.`animal_id` = `a`.`id`) and (`d`.`type` = 'owner')))) left join `agents` `e` on((`e`.`id` = `d`.`agent_id`))) left join `animal_report_short` `mom` on((`mom`.`id` = `a`.`mom`))) left join `animal_report_short` `dad` on((`dad`.`id` = `a`.`dad`))) where isnull(`a`.`deleted_at`) */;

