/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `animal_tournament` AS select `a`.`tournament_id` AS `tournament_id`,`a`.`animal_id` AS `animal_id`,`a`.`total_categories` AS `total_categories`,`d`.`prefix` AS `prefix`,`b`.`name` AS `name`,`b`.`code` AS `code`,date_format(`b`.`birthdate`,'%d-%m-%Y') AS `birthdate`,`d`.`names` AS `breeder`,`f`.`names` AS `owner` from (((((`animal_tournament_short` `a` join `animals` `b` on((`b`.`id` = `a`.`animal_id`))) left join `animal_agent` `c` on(((`c`.`animal_id` = `b`.`id`) and (`c`.`type` = 'breeder')))) left join `agents` `d` on((`d`.`id` = `c`.`agent_id`))) left join `animal_agent` `e` on(((`e`.`animal_id` = `b`.`id`) and (`e`.`type` = 'owner')))) left join `agents` `f` on((`f`.`id` = `e`.`agent_id`))) where isnull(`b`.`deleted_at`) */;

